import React from 'react';
import './Repo.css';
export default class SearchBar extends React.Component {

  render() {
    return (
    <ul className = "repo">
     { this.props.repos.map(repos => 
     <li>
       <hr />
       <h1 class = "float-left"> Repository name: {repos.name} </h1>
       <span class = "float-right"> Language: {repos.language || '-'} </span>
       <span class = "float-right"> Created at: {repos.creationDate} </span>
       <span class = "float-right"> Last Update: {repos.lastUpdate} </span>

       <p class = "float-left"> Description: {repos.description || '-'} </p>
       <span class = "float-left"> Clone: </span>
       <span class = "float-left"> SSH: </span>
      </li>) 
     }
    </ul>
    );
  }
}
